import React, { Component } from "react";
import ReactDOM from "react-dom";
import BootstrapTable from "react-bootstrap-table-next";
import "bootstrap/dist/css/bootstrap.min.css";
import "react-bootstrap-table-next/dist/react-bootstrap-table2.min.css";
import "./AdminPannel.css";
import { Button } from "react-bootstrap";

const users = [
  { id: 1, name: "User 1", username: "User1", email: "user1@test.com" },
  { id: 2, name: "User 1", username: "User2", email: "user2@test.com" },
];

class AdminPannel extends Component {
  constructor() {
    super();
    this.state = {
      // For displaying data
      columns: [
        {
          dataField: "id",
          text: "id",
          sort: true
        },
        {
          dataField: "name",
          text: "Name",
          sort: true
        },
        {
          dataField: "username",
          text: "Username"
        },
        {
          dataField: "email",
          text: "Email"
        },
        {
          dataField: "delete",
          text: "Delete",
          formatter: this.linkDelete,
          sort: true
        }
      ],
      isDelete: true
    };

    this.onDeleteChanged.bind(this);
  }

  onDeleteChanged() {
    this.setState({ isDelete: !this.state.isDelete });
    console.log(this.state.isDelete);
  }

  linkDelete = (cell, row, rowIndex, formatExtraData) => {
    return (
      <Button
        onClick={() => {
          this.onDeleteChanged(row);
        }}
      >
        Delete
      </Button>
    );
  };

  render() {
    return (
      <div style={{ padding: "20px" }}>
        <h1 className="h2">Users</h1>
        <BootstrapTable
          keyField="id"
          data={products}
          columns={this.state.columns}
        />
      </div>
    );
  }
}

export default AdminPannel;
